import React, {useState, useEffect} from "react";
import { Nav, NavbarContainer, NavLogo, HamburgerIcon, NavMenu, NavItem, NavLinks, NavItemBtn, NavBtnLink } from "./Navbar.elements";
import { Button } from "../../styles";
import GithubLogo from '../../images/GitHub-Logo.png';

function Navbar() {
    return (
        <Nav>
            <NavbarContainer>
                <NavLogo to='/'> 
                    <strong>DeKeys</strong>
                </NavLogo>

                <NavMenu>
                    <NavItemBtn>
                        <Button 

                            onClick={ (e) => {
                                e.preventDefault();
                                window.location.href = "https://github.com/DeKeys";
                            }}
                        >
                            <img src={GithubLogo} width="34" height="34"/>
                            <strong>Source Code</strong>
                        </Button>
                    </NavItemBtn>
                </NavMenu>
            </NavbarContainer>
        </Nav>
    )
}

export default Navbar;
